INSERT INTO `missing_people_data_table`(`missingID`, `type`, `missingName`, `sex`, `birthDate`, `height`, `missingDate`, `missingPlace`, `description`, `extraData`, `registrationDate`, `lng`, `lat`, `hasPhoto`, `missingPeopleState`, `userName`) VALUES (614182, '家寻宝贝', '文渊慧', '女', '2009-04-14', '2厘米左右', '2022-05-02', '陕西省,咸阳市,陕西省咸阳市旬邑土桥镇', '文渊慧，女，13岁，陕西省咸阳市旬邑县土桥镇，镇头村人。5月2日中午1:00点左右，离家出走，走时穿下图中的黄色短袖，粉色卫衣和黑色裤子，身号1.67左右，体重95斤，走时穿粉色的卫衣(胸前小熊图案，)黑色裤子，电话15691039760/13028553848', '你好，我女儿叫文渊慧，5.2号早上我放玉米苗去了，回来后看到我女儿好像哭过，我问咋了，她没说话，就去厕所了，听我儿子说我女儿和任停停吵了一架，过了一会我女儿回来了，我看她挺开心，也没说啥，她拿一件校服出去了，我问她去哪，她说给任停停衣服去，说任停停的校服，我也没在意，就说，呆会吃饭呢，她说嗯。我儿子在门口玩呢，跑回来说妈，她姐走了，我跑出去问她干啥去，她说去商店买个东西2分钟就回来，就出去了，1点左右，我发语音叫她吃饭呢也没回我，我想孩子可能玩呢，就地里去了，晚上回来后，我问我儿子你姐呢？她说没回来，我就给我老公打电话到处找呢！5月3号7点多在土桥派出所报案，他们就说自己找，他们配合，今天下来4天了，也没有任何消息，到处找，到处调监控都没有行踪，5.1号任停停她哥(任小龙)晚上10点30左右给我女儿转了80块钱，她走时就带了110左右文渊慧，女，13岁，陕西省咸阳市旬邑县土桥镇，镇头村人。5月2日中午1:00点左右，离家出走，走时穿下图中的黄色短袖，粉色卫衣和黑色裤子，身号1.67左右，体重95斤，走时穿粉色的卫衣(胸前小熊图案，)黑色裤子，电话15691039760/13028553848', '2022-05-06', 108.43424860477403, 35.02144461620395, 1, 0, 'admin');
