INSERT INTO `missing_people_data_table`(`missingID`, `type`, `missingName`, `sex`, `birthDate`, `height`, `missingDate`, `missingPlace`, `description`, `extraData`, `registrationDate`, `lng`, `lat`, `hasPhoto`, `missingPeopleState`, `userName`) VALUES (615127, '其他寻人', '韦世安烈士（寻家）', '男', '1950-01-01', '未知', '1950-01-01', '贵州省,六盘水市,六枝特区,于1950年牺牲，安葬于贵州省六枝特区东风水库烈士陵园', '1.贵州省安顺市普安县刘淮楚同志撰写的“【普定红色记忆】梨花村清匪记”中描述：中国人民解放军17军49师146团、中共普定县委于1950年4月20日成立了“普定县剿匪指挥部，时任马场区公安特派员刘淮楚被任命为剿匪指挥部情报组的副组长”，而韦世安烈士曾在中国人民解放军17军49师146团警卫营一连当副班长。\r\n2.贵州省六盘水刘六枝特区纪委监委公开的“【史海钩沉】六枝大小屯剿匪战斗遗迹”中描述：1950年5月25日，盘踞岩脚的叛匪保安团李成举、王孝传部和从落别、大用等处被击溃残余之匪围攻六枝区机关住所的大小屯。在小屯上的区机关全体干部及区保安队一同反击土匪的进攻，经过两天激战，因无外援，弹尽力竭，被土匪攻上山顶，区长王洪庆、保安队长杨英学、助理员刘春芳、詹斗南、韦世安等英勇牺牲。146团3营从落别经大用赶来救援时，战斗已经结束，土匪已向岩脚隐匿。在六枝大小屯反击叛匪围攻的战斗中牺牲的6名烈士中(其中1人为被俘3天后牺牲)，有3名不远千里来到贵州。韦世安，广西都安县呜凤乡人，1949年参加革命。中国人民解放军一七军四九师一四六团警卫营一连副班长，郎岱解放后，在六枝区人民政府工作。刘春芳，山东人，1949年随军南下解放贵州，郎岱县人民政府成立后，在六枝区人民政府任财政助理员。詹斗南，江西人，中国人民解放军17军49师146团排长，1949年随军解放贵州，郎岱解放后，在六枝区人民政府负责税务工作。', '一、“寻亲”情况\r\n1.大化县大化镇流水社区江那屯韦汉录疑为其爷爷韦金通（东）。据家族老人记忆，韦金通（东）生前为都安县鸣凤乡人，约生于1910年，其父为韦士（世）安，韦金通育有二子韦瑞吉、韦瑞德均已过世。韦瑞吉在世时称其父韦金通于其年幼时因抗美援朝征兵入伍，后得到消息其牺牲于外地，但因年久无任何书面信息留存。迄今，虽经多方寻找仍无韦金通任何线索，后人立其墓亦为衣冠墓。\r\n2.大化县大化镇春兴村韦孟和疑为其第二次当兵后下落不明的二伯韦世明。据了解，韦世明早年当兵回乡后又替其三弟（韦孟和父亲韦世蔺）当“壮丁”，中途寄过一封信回家乡，信中告知家人自己已改名（具体名字不知道，知悉这封信情况的人已逝世），后面就再也没有音讯了，家人认为去当“壮丁”可能死在哪里了，所以也没有去打听，直到这次在网络上见到“为烈士寻亲”消息，才认为“韦世安烈士”有可能就是自己下落不明的二伯韦世明。\r\n', '2022-05-09', 105.45007786836668, 26.24892095871419, 1, 0, 'admin');
INSERT INTO `missing_people_data_table`(`missingID`, `type`, `missingName`, `sex`, `birthDate`, `height`, `missingDate`, `missingPlace`, `description`, `extraData`, `registrationDate`, `lng`, `lat`, `hasPhoto`, `missingPeopleState`, `userName`) VALUES (614519, '其他寻人', '崔用敏', '未知', '1964-01-02', '160厘米左右', '1995-11-30', '安徽省,六安市,霍山县,霍山县城关汽车站', '精神异常，属龙，爱自言自语，爱笑，穿着干净，爱漂亮，安徽六安霍山口音，小学读到四年级。识字。身体健康。育有3个小孩，双双，圆圆，亮亮。', '会骑自己车。喜欢花。以前经常骑自行车，车后座邦着花。', '2022-05-08', 116.27978186269335, 32.33818527224355, 1, 0, 'admin');
